import React from "react";
import styled from "styled-components";


function LAMMIcon() {
  return (
    <LAMMIcon1>
      <GroupContainer>
        <Group19></Group19>
        <Group21></Group21>
      </GroupContainer>
    </LAMMIcon1>
  );
}

const LAMMIcon1 = styled.div`
  position: absolute;
  height: 228px;
  top: 349px;
  left: 204px;
  display: flex;
  align-items: flex-end;
  min-width: 373px;
  transition: all 0.2s ease;
  background-image: url(/img/group-16-1@1x.png);
  background-size: cover;
  background-position: 50% 50%;
  cursor: pointer;

  &:hover {
    opacity: 0;
  }
`;

